import Cookies from 'js-cookie'
import { Link } from 'react-router-dom'

const Logout = () => {

  const id = Cookies.get('id')
  console.log(id)
  let button

  if (!id) {
    button = <button>Login</button>
  } else {
    button = <button>Logout</button>
  }

  return (
     {button}
    )

}

export default Logout
